import React from "react";
import "./App.css";

import List from "./componets/List";

class App extends React.Component {
  state = {
    blocktext: [
      {
        text: "asdiohdasidh",
      },
    ],
  };

  render() {
    return (
      <div className="App">
        <div className="name">
          <h2>Bob</h2>
        </div>
        <List blocktext={this.state.blocktext} />
      </div>
    );
  }
}

export default App;
